import React, { useRef, useEffect } from "react";

const Marquee = (props) => {
  return (
    <marquee  direction={props.dir} loop>
      <div style={{ display: "flex", width: '', justifyContent: 'space-evenly' }} id="marque">
        {new Array(8).fill(2).map((data, i) => (
          <div
            style={{
              width: "60px",
            //   float: props.dir,
              aspectRatio: "1/1",
              display: "flex",
              alignItems: "center",
              justifyContent: 'center',
              border: "1px solid #023d65",
              borderRadius: "50%",
              marginLeft: '20px'
            }}
          >
            {i}
          </div>
        ))}
      </div>
    </marquee>
  );
};

export default Marquee;
